import uuid,base64,re

def iconname(ename):
	rex=re.compile(r'(?P<FIRST>.)(?P<ICO>.*?)(?P<CAP2>[A-Z])',re.VERBOSE)
	res=rex.search(ename)
	return '{FIRST}{ICO}'.format(FIRST=res['FIRST'], ICO=res['ICO'])


